    "Population dynamics and trophic relationships of marine birds in the Gulf of Alaska
    and southern Bering Sea: Part I, general introduction: Annual report",nt"tracking_summary":
    {ntt"total": 5,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:01:46.120845",nt"name": "population-dynamics-and-trophic-relationships-of-marine-birds-in-the-gulf-of-alaska-and-so",nt"isopen":
    false,nt"url": null,nt"notes": "Site-specific studies of marine birds were
    conducted at 13 locations in the Gulf of Alaska and southern Bering Sea during the
    1976 field season. Although the studies did not adequately consider all species
    or habitats in the regions concerned, the locations contained diverse habitats and
    species assemblages which were believed to be at least representative of other colony
    locations in the northern Gulf and 6outhern Bering Sea. Studies at 10 locations
    focused on traditional "seabirds" while those at three locations focused primarily
    on shorebirds or both shorebirds and waterfowl. Species best represented on the
    study areas included murres, Tufted and Horned Puffins, Black-legged Kittiwakes,
    Glaucous-winged gulls, and Pelagic Cormorants. Other species such as the Northern
    Fulmar and some small alcids were represented on only one study area. The high seasonal
    and local variability in populations and production indicates that continuing studies
    will be required to adequately evaluate average long term productivity on population
    levels over a broad geographic region.",nt"license_title": "License Not Specified",nt"extras":
